import React from "react";

function Checkout() {
  return (
    <div>
      <h1>Checkout here as a guest, soon as a signed up user!</h1>
      <p>This is more information.</p>
      <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
    </div>
  );
}


export default Checkout;
